		<div className="h-screen bg-bkg text-sm" data-theme="">
			<MainNavigation className="max-w-[1080px] w-[90%] m-auto h-full" />
			<main className="max-w-[1080px] w-[90%] m-auto">
				<Outlet />
			</main>
		</div>
	);
}
